import React from "react";
import { Card } from "../../UI/Card.styled";

const NavBar = () => {
  return (
    <Card
      mg={"1rem 15%"}
      height={"2rem"}
      width={"70%"}
      bd={"1px solid red"}
      dp={"grid"}
      gridC={"25% 35% 40%"}
    >
      <Card bd={"1px solid red"}></Card>
    </Card>
  );
};

export default NavBar;
